  grid-auto-rows: auto;
  gap: 10px;
  height: calc(100% - 2rem);
  width: 100%;
`;

export const NavBar = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
  height: calc(100% - 2rem);
  padding: 10px;
  background-color: #f5f5f5;
  border-radius: 10px;
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
`

export const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
  height: calc(100% - 2rem);
  padding: 10px;
  background-color: #EC9BD5;
  border-radius: 10px;
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
`

export const SideContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
  height: 100%;
  background-color: #f5f5f5;
  border-radius: 10px;
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
`

export const SmallContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
  padding: 10px;
  background-color: #f5f5f5;
  border-radius: 10px;
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
  z-index: 1;
`
